    """Return the nth Fibonacci number F(n) with F(0)=0, F(1)=1."""
    if n < 0:
        raise ValueError("n must be non-negative")

    def _fib_pair(k: int) -> tuple[int, int]:
        # Returns (F(k), F(k+1)) using fast doubling
        if k == 0:
            return 0, 1
        a, b = _fib_pair(k >> 1)
        c = a * ((b << 1) - a)      # F(2k)
        d = a * a + b * b           # F(2k+1)
        if k & 1:
            return d, c + d
        else:
            return c, d

    return _fib_pair(n)[0]

