    """
    Return the nth Fibonacci number (0-indexed): F(0)=0, F(1)=1.
    Uses fast doubling for O(log n) time and O(log n) space.
    """
    if n < 0:
        raise ValueError("n must be a non-negative integer")

    def _pair(k: int):
        if k == 0:
            return (0, 1)
        a, b = _pair(k >> 1)
        c = a * (2 * b - a)
        d = a * a + b * b
        if k & 1:
            return (d, c + d)
        else:
            return (c, d)

    return _pair(n)[0]

def fib(n: int) -> int:
    """
    Return the nth Fibonacci number with F(0)=0, F(1)=1.
    Uses fast doubling for O(log n) time.

    Raises:
        ValueError: if n is negative.
    """
    if n < 0:
        raise ValueError("n must be non-negative")

    def _dbl(k: int) -> tuple[int, int]:
        if k == 0:
            return (0, 1)
        a, b = _dbl(k >> 1)  # (F(m), F(m+1))
        c = a * ((b << 1) - a)      # F(2m)
        d = a * a + b * b           # F(2m+1)
        if k & 1:
            return (d, c + d)       # (F(2m+1), F(2m+2))
        else:
            return (c, d)           # (F(2m), F(2m+1))

    return _dbl(n)[0]
